INSERT INTO `profesional` (`name`, `namekg`, `id`, `variable_new`) VALUES
('М – профессии, в которых важны: умение работать руками, осязание, ловкость, координация зрения и рук, быстрота, сила и выносливость. Точная работа с использованием инструментов (механика, ремесло, столярная работа, инженер, проектировщик).', 'М – кол менен иштей билүү, сезүү, ыкчамдык, көрүүнү жана колду  координациялоо, шамдагайлык, күч менен чыдамкайлык маанилүү болгон кесиптер. Инструменттерди пайдалануу менен аткарылуучу так иштер (механика, өнөр, жыгач устачылык иштери, проекттерди түзгөн адис).', 1, '$resul'),
('Р – профессии, в которых важны: счет, действия над числами, ведение бухгалтерской отчетности, проведение инвентаризации, подсчет с высокой точностью, умения в области финансов, выполнение калькуляции, проведение статистического анализа, оценка расходов, финансовые операции (экономика, банковское дело, налоговый инспектор, секретарь, финансист). ', 'Р – эсеп, сандар менен иштөө, бухгалтердик отчеттуулукка киришүү, инвентаризация жүргүзүү, тактык менен эсептөө, каржы тармагындагы билгичтик, калькуляцияларды аткаруу, статистикалык анализ жүргүзүү, чыгымдарды баалоо, каржы операциялары (экономика, банк иши, салык инспектору, кат жазуучу (секретарь), финансист ж.б.у.с. манилүү болгон кесиптер).', 2, '$resul1'),
('Х – умения оценить возможности других людей, быстро ориентироваться в ситуации, реалистично оценить потребности других людей, влиять на людей, вызывать доверие, мотивировать, ясно выражать мысли, организаторские способности, хорошая память (торговля, маркетолог, офисная работа, административная работа, милиционер). ', 'Х – башка адамдардын мүмкүнчүлүктөрүн баалай билүү, кырдаалды тез түшүнүү, башка адамдардын муктаждыктарын реалдуу баалоо, адамдарга таасир этүү, ишеним жаратуу, шыкактоо, оюн ачык туюндуруу, уюштуруучулук жөндөм, жакшы эс тутум (соода тармагы, маркетолог, административдик жана кеңсе иштери, милиция кызматкери).', 3, '$resul2'),
('Й – умение грамотно говорить и писать, выступать перед аудиторией, чувствовать ее настроение, читать лекции, давать инструкции, разъяснять, толковать чьи-либо идеи, переводить с иностранного языка (переводчик, учитель, журналист, ведущий телепрограммы).', 'Й – сабаттуу сүйлөй жана жаза алуу, аудитория алдында чыгып сүйлөө, аудиториянын маанайын сезе билүү, лекция окуу, инструкция берүү, түшүндүрүү, кимдир бирөөлөрдүн идеяларын түшүндүрүп берүү, чет тилдеринен которуу (котормочу, мугалим, журналист, телепрограммаларды алып баруучу).', 4, '$resul3'),
('В – исследование, деятельность, связанная с идеями, концепциями, информацией, постоянная заинтересованность, любовь к печатному слову, постоянное самообразование и развитие, делать открытия, поиск в базах данных (ученый, исследователь, историк, лингвист, библиотекарь, PR связь с общественностью).', 'В – изилдөө иштери, идеялар, концепциялар, маалыматтар менен байланышкан ишмердик, басма иштерине туруктуу кызыгуу, аны сүйүү, өзүн-өзү дайыма өркүндөтүп туруу, ачылыштарды жасоо, маалыматтар базасында издөө жүргүзүү (окумуштуу, изилдөөү, тарыхчы, лингвист, китепканачы, коомчулук менен байланыш (PR)).', 5, '$resul4'),
('С – близкий контакт с людьми, умение начинать разговор с незнакомыми людьми, внимательное и точное слушание, интуитивное понимание, умение наблюдать за поведением других, точная оценка настроений в обществе, помощь людям с психическими, профессиональными, духовными проблемами и т.п., (терапевт, психолог, соц. педагог, соц. работник, специалист по профориентации, врач, медсестра).', 'С – адамдар менен жакындан контакт, бейтааныш адамдар менен маек түзө билүү, көңүл коюп так уга билүү, интуициясы менен түшүнүү, башкалардын жүрүм-турумуна көз сала билүү, коомдогу манайды так баалай билүү, психикалык, кесиптик жана рухий көйгөйү бар адамдарга жардам берүү, ооругандарды багуу ж.б. (терапевт, психолог, соц. адис, соц. педагог, кесипке багыт берүү боюнча адис, врач, медайым).', 6, '$resul5'),
('К – контакты с другими людьми, скорее, поверхностны, выполнение поручений, обеспечение услуг без установления близких межличностных отношений (продавец, сфера торговли, сфера услуг, супервайзер, торговый агент, трейдер). ', 'К – башка адамдар менен алака үстүртөн болот, тапшырмаларды аткаруу, кызмат көрсөтүү же кызмат көрсөтүүгө жардам көрсөтүү, жеке жакын мамиле түзбөстөн кызмат көрсөтүү (сатуучу, соода сатык, кызмат көрсөтүү, супервайзер, соода агенти, трейдер, логист).', 7, '$resul6'),
('Т – работа, связанная с постоянным движением, сменой окружения, работа вне помещения, мобильность, физическая выносливость, способность к адаптации, стрессоустойчивость, интерес к миру и людям, легкость в установлении контактов (путешествия, командировки, транспорт, экскурсовод, гид, профессии в сфере туризма). ', 'Т – дайыма кыймылда болуу, чөйрөсүн өзгөртүп туруу менен байланышкан иштер, имараттан сырткары жерде иштөө, мобилдүүлүк, физикалык көтөрүмдүүлүк, адаптацияга жөндөмдүүлүк, стресске туруктуулук, дүйнөгө жана адамдарга кызыгуу, байланышты жеңил түзүү (саякат, иш сапар, айдоочу, экскурсовод, гид ж.б.у.с.).', 8, '$resul7'),
('П – профессии, связанные с работой на свежем воздухе, выращивание растений, умелый уход за животными, животноводство (фермер, лесник, животновод, огородник, егерь, эколог). ', 'П –  таза абада иштөө менен байланышкан кесиптер, өсүмдүктөрдү өстүрүү, жаныбарларды багуу (фермер, токойчу, мал багуучу, багбан, егерь, эколог).', 9, '$resul8'),
('А – креативность, творчество, генерирование новых идей, предложение и внедрение инноваций, создание концепций, оригинальность, импровизация, богатое воображение, сочинение музыки (проектировщик, программист, веб-разработчик, архитектор, художник, композитор, графический дизайнер). ', 'А – креативдүүлүк, чыгармачылык, жаңы идеялдарды генерациялоо, инновацияларды сунуштоо жана ишке ашыруу, концепцияларды түзүү,  оригиналдуулук, импровизация, элестетүүсүнүн байлыгы, музыка жазуу (долбоор түзүүчү, программист, архитектор, композитор, сүрөтчү, графикалык дизайнер).', 10, '$resul9');
